import React from 'react';
import ReactDOM from 'react-dom';
import { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.js';
import './css/dashboard.css';
import './css/appointment.css';
import './css/pharmacy.css';
import './css/login.css';
import {AllAppointments} from './App'
import {Navbar} from './App'
import {Doctorsection} from './App';
import {Pharmacy} from './App';

  function Connectapp(){
    return( 
      <Router>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Doctorsection/>}/>
        <Route path='/Appointments' element={<AllAppointments/>}/>
        <Route path='/Pharmacy' element={<Pharmacy/>}/>
      </Routes>
    </Router>
    );
  }
  function Login(){
    const [next,setnext] =useState('none');

    return(
      <>
  <div className='container-fluid'>
    <navbar className="navbar mb-5 justify-content-end">
    <img src={process.env.PUBLIC_URL + "/images/logo.png"} className="float-end img-fluid col-lg-1 col-3 me-lg-5 me-2" />
    </navbar>


  <section className="signinsection mb-5">
    <div className="container rounded py-5 bg-light bg-opacity-75">
      <div className="col-5 m-auto position-relative pb-2">
        <p className="text-center mt-2 m-auto col-6" id="text1"><img src={process.env.PUBLIC_URL + "/images/slogan1.png"} className="img-fluid" /></p>
        <p className="text-center mt-2 position-absolute col-6" id="text2"><img src={process.env.PUBLIC_URL + "/images/slogan2.png"} className="img-fluid" /></p>
      </div>

      <form>
        <div className="mt-4">
          <div className="row justify-content-center mb-4" id="userinput">
            <div className="col-1"></div>
            <div className="col-lg-6 col-md-8 col-sm-10 col-10 align-items-center d-flex userinput">
              <p className="m-0 ms-1" id="inputheading">Enter your Aartas Email ID</p>
              <input type="email" className="form-control" id="userbox" placeholder="example@aartas.com" autocomplete="false"
               onChange={
                (e)=>{if(e.target.value !=null)
                      {setnext('block');if(e.target.value !=null){setnext('none')}}}}/>
            </div>
            <div className={`col-lg-1 d-${next} col-2 align-items-center d-flex`}>
              <a className="next text-decoration-none text-center p-2 rounded" id="next">Next</a>
            </div>

          </div>
          <div className="row justify-content-center" id="passinput">
            <div className="col-lg-1 col-2 col-md-1 align-items-center d-flex">
              <a className="back text-decoration-none text-center p-2 rounded" onclick="back()">Back</a>
            </div>
            <div className="col-lg-6 col-md-8 col-sm-10 col-10 align-items-center d-flex userinput">
              <p className="m-0" id="inputheading">Enter your Password</p>
              <input type="password" className="form-control" id="passwordbox" placeholder="examplepassword123" autocomplete="new-password"/>
            </div>
            <div className="col-1 align-items-center justify-content-center d-flex">
              <button type="button" className=" p-2 rounded submit text-center">Submit</button>
            </div>
            <div className="col-12">
              <div className="col text-center">
                <input className="form-check-input" onclick="passvisibility()" type="checkbox" value="" id="flexCheckDefault"/>
                <label className="form-check-label" for="flexCheckDefault">Check Password</label>
              </div>
            </div>
            <div className="col-5 text-center"><a href="#" className="text-decoration-none">forgot password</a></div>

          </div>
        </div>
      </form>
    </div>
  </section>
  </div>
  </>
    )
  }
function Authentication(){

return (
  <>
  <Login/>
  </>
)
}
ReactDOM.render(<Authentication /> , document.getElementById("root"));
